import React, {Component} from 'react'
import data from './sectionInfo'

class DisplayTable extends Component {
    jsonData = data;

    render() {
        return (
            <div>
                <h1>{jsonData[0]}</h1>
            </div>
        )
    }
        

    
}
    
export default DisplayTable
